import React, { Component } from 'react'
import QrReader from 'react-qr-reader'

export default class Test extends Component {
    state = {
        result: ''
      }

      handleScan = data => {
        if (data) {
          this.setState({
            result: data
          })
        }
      }
      handleError = err => {
        console.error(err)
      }

    render() {
        return (
            <div>

            </div>
          )
        }
